import React, { Component } from "react";
import "./styles/App.css";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Navbar from "./components/NavBar.js";
import GridLayout from "./components/NewGridLayout.js";
import Modal from "./components/Modal.js";
import Landing from "./components/Landing";
import Register from "./components/auth/Register";
import Login from "./components/auth/Login";

import { Provider } from "react-redux";
import store from "./store";



class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      height: 250,
      width: 250,
      show: false,
      modalContents: {
        type: "What",
        title: "This Is a Message"
      }
    };
  }

  showModal = () => {
    this.setState({ show: true });
  };

  hideModal = () => {
    this.setState({ show: false });
  };

  setSize = (height, width) => {
    this.setState({
      height: parseInt(height),
      width: parseInt(width)
    });
  };
  showRequestModal = (type, message) => {
    this.setState({
      modalContents: {
        type: "request",
        title: "Lets Get This Park Started"
      }
    });
    this.showModal();
  };
  showHelpModal = (type, message) => {
    this.setState({
      modalContents: {
        type: "help",
        title: "Unsure of where to start?"
      }
    });
    this.showModal();
  };


  render() {
    return (
      <Provider store={store}>
      <Router>
      <div className="App">
        <Navbar
          setSize={this.setSize}
          request={this.showRequestModal}
          help={this.showHelpModal}
        />
        <Route exact path="/" component={Landing} />
          <Route exact path="/register" component={Register} />
          <Route exact path="/login" component={Login} />
          {/*<Route exact path="/builder" component{gridLayout}>
        <Modal
          show={this.state.show}
          handleClose={this.hideModal}
          title={this.state.modalContents.title}
          type={this.state.modalContents.type}
        />

        <GridLayout width={this.state.width} height={this.state.height} />*/}
      </div>
      </Router>
      </Provider>
    );
  }
}

export default App;
